void circle_foresee() {
    int midx = (left_line[108] + right_line[108]) / 2;
    int midy = NEAR_LINE;
    int k = 0;

    for (int i = 0; i <= CAMERA_W; i++) {
        for (int j = 0; j <= NEAR_LINE; j++) {
            if ((i - midx) * (i - midx) + (j - midy) * (j - midy) < ForeSee + 1 && (i - midx) * (i - midx) + (j - midy) * (j - midy) >= ForeSee) {
                foreSee[k].x = i;
                foreSee[k].y = j;
                k++;
            }
        }
    }


}

