////////////////////////////////////////////
//功能：斜率特征提取
//输入：
//输出：y为分母的斜率
//备注：最小二乘法
///////////////////////////////////////////
double calculate_slope(int start, int end, int type) {

    double ySum = 0;
    double y2Sum = 0;
    double xSum = 0;
    double xySum = 0;
    int num = end - start + 1;
    if (end >= 106) {
        end = 106;
    }
    if (start <= 0) {
        start = 0;
    }

    for (int i = start; i <= end; i++) {
        if (right_line[i] == left_line[i]) {
            type = 0;
        }
    }

    if (type == 1) {
        for (int i = start; i <= end; i++) {
            xSum += left_line[i];
            ySum += i;
            y2Sum += i * i;
            xySum += i * left_line[i];
        }
        if ((num * y2Sum - ySum * ySum) != 0) {
            double leftSlope = (double)(num * xySum - xSum * ySum) / (num * y2Sum - ySum * ySum);
            return leftSlope;
        }
        else {
            return 0;
        }
    }
    else if (type == -1) {
        for (int i = start; i <= end; i++) {
            xSum += right_line[i];
            ySum += i;
            y2Sum += i * i;
            xySum += i * right_line[i];
        }
        if ((num * y2Sum - ySum * ySum) != 0) {
            double rightSlope = (double)(num * xySum - xSum * ySum) / (num * y2Sum - ySum * ySum);
            return rightSlope;
        }
        else {
            return 0;
        }
    }
    else if (type == 0) {
        return MISSHAPPEN;
    }


}
